    "Advanced Li/S Batteries Based on Novel Composite Cathode and Electrolyte System
    Project",nt"tracking_summary": {ntt"total": 1,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-05-07T03:50:25.198782",nt"name":
    "advanced-li-s-batteries-based-on-novel-composite-cathode-and-electrolyte-system-project-d211d",nt"isopen":
    true,nt"url": null,nt"notes": "Energy storage devices in many aerospace
    applications are facing unique challenges. Most of such applications, including
    remote surveillance, satellites, reusable launch vehicles, etc. depend on high-performance,
    highly specialized batteries. In Phase I, STI prepared and tested several sulfur-carbon
    nanocomposites of different formulations to identify parameters that affect composite
    performance characteristics.  High efficient electrolyte solvent was prepared and
    demonstrated with high Coulombic efficiency and good cycling performance.  During
    the Phase II, the composite's composition will be optimized further. Electrolyte
    solvent will be further optimized to increase the purity and Li ion conductivity.
     In parallel, cells with 500 mAh capacity will be designed and prototype batteries
    will be fabricated and characterized.",nt"license_title": "U.S. Government
